import React from 'react';
import { connect } from 'react-redux';
import { fetchDatas } from '../Actions';


class PharmacyList extends React.Component {

    componentDidMount(){
        this.props.fetchDatas();
    }

    renderList() {
        return this.props.phardatas.map(data => {
            return(
                <div>
                    <ul>
                        <li>{data.eczane_adi}</li>
                    </ul>
                </div>
            );
        });

    }

    render(){
        return(
            <div>
                <h2 style={{marginTop:10}}>DATAS</h2>
                {this.renderList()}
            </div>
        );
    }

 };

 const mapStateToProps = state => {
     return {
         phardatas: state.datas
     }
 }

 export default connect(mapStateToProps, {fetchDatas})(PharmacyList);
